import { AUTHENTICATE_USER, LOG_OUT } from "./typeDefinitions";

export const signOut = (id) => {
    return {
        type: SIGN_OUT,
        id
    };
}

export const authenticateUser = (username) => {
    return {
        type: AUTHENTICATE_USER,
        username
    };
}
